import React, { ReactNode } from 'react';

interface IProps {
  children?: ReactNode;
  name: string;
  age?: number;
}

const Discover: React.FC<IProps> = (props): JSX.Element => {
  return (
    <div>
      <div>Discover component</div>
      <div>{props.name}</div>
      <div>{props.age}</div>
    </div>
  );
};

Discover.defaultProps = {
  name: 'ninjee',
  age: 18
};

export default Discover;
